1.begin{equation} 
   \text{给定不等式:} \quad -4 < x^4 + 4x^2 < 21.

\end{equation}

2. rewrite the inequality by isolating the quadratic term. 

   \begin{equation}
   x^4 + 4x^2 + 4 < 25.
   \end{equation}

   Notice that we add 4 to both sides to complete the square:

\begin{equation}
x^4 + 4x^2 + 4 = (x^2 + 2)^2.
\end{equation}

3. Substitute back into the inequality:

   \begin{equation}
   (x^2 + 2)^2 < 25.
   \end{equation}

4. Take the square root on both sides, remembering the roots can be positive or negative:

   \begin{equation}
   -5 < x^2 + 2 < 5.
   \end{equation}

5. Isolate the term \( x^2 \) by subtracting 2 from all parts of the inequality:

   \begin{equation}
    -5 - 2 < x^2 < 5 - 2,
   \end{equation}

   Simplifying gives:

   \begin{equation}
   -7 < x^2 < 3.
   \end{equation}

6. Since \( x^2 \) is always non-negative, we restrict \( x^2 \) to be in the interval \([0, 3)\):

   \begin{equation}
   0 \leq x^2 < 3.
   \end{equation}

7. Take the square root of both sides, noting that \( x \) can be positive or negative:

   \begin{equation}
   -\sqrt{3} < x < \sqrt{3}.
   \end{equation}

Conclusion:
\[
\boxed{(-\sqrt{3}, \sqrt{3})}
\] 

This interval represents the solution to the inequality \( -4 < x^4 + 4x^2 < 21 \). The final answer is \( (-\sqrt{3}, \sqrt{3}) \). 

This is derived using algebraic manipulation and properties of inequalities, ensuring all steps are logically sound and complete.
